 -- New section 

CREATE TABLE IF NOT EXISTS countries (
	id SERIAL NOT NULL PRIMARY KEY,
	name VARCHAR(120) NOT NULL
);



 -- New section 

CREATE TABLE IF NOT EXISTS cities (
	id SERIAL NOT NULL PRIMARY KEY,
	name VARCHAR(120) NOT NULL,
	country_id INTEGER NOT NULL,
	CONSTRAINT cities_country_id_countries_id_FK FOREIGN KEY(country_id) REFERENCES countries(id) ON DELETE CASCADE ON UPDATE CASCADE
);



 -- New section 

CREATE TABLE IF NOT EXISTS address (
	id SERIAL NOT NULL PRIMARY KEY,
	address_line VARCHAR(250) ,
	postcode VARCHAR(120) ,
	city_id INTEGER NOT NULL,
	CONSTRAINT address_city_id_cities_id_FK FOREIGN KEY(city_id) REFERENCES cities(id) ON DELETE CASCADE ON UPDATE CASCADE
);



 -- New section 

CREATE TABLE IF NOT EXISTS user_adress (
	id SERIAL NOT NULL PRIMARY KEY,
	address_type VARCHAR(120) DEFAULT 'billing address' NOT NULL,
	address_id INTEGER NOT NULL,
	user_id INTEGER NOT NULL,
	CONSTRAINT user_adress_address_id_address_id_FK FOREIGN KEY(address_id) REFERENCES address(id) ON DELETE CASCADE ON UPDATE CASCADE,
	CONSTRAINT user_adress_user_id_users_id_FK FOREIGN KEY(user_id) REFERENCES users(id) ON DELETE CASCADE ON UPDATE CASCADE
);

